Most efficient way to put fields of an embedded document in its parent for an entire MongoDB collection?<p>I am looking for the most efficient way to modify all the documents of a collection from this structure:</p>

<pre><code>{
  [...]
  myValues:
  {
     a: "any",
     b: "content",
     c: "can be found here"
  }
  [...]
}
</code></pre>

<p>so it becomes this:</p>

<pre><code>{
   [...]
   a: "any",
   b: "content",
   c: "can be found here"
   [...]
}
</code></pre>

<p>Basically, I want everything under the field <code>myValues</code> to be put in its parent document for all the documents of a collection.</p>

<p>I have been looking for a way to do this in a single query using <code>dbCollection.updateMany()</code>, put it does not seem possible to do such thing, unless the content of <code>myValues</code> is the same for all documents. But in my case the content of <code>myValues</code> changes from one document to the other. For example, I tried:</p>

<pre><code>db.getCollection('myCollection').updateMany({ myValues: { $exists: true } }, { $set: '$myValues' });
